import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import Navbar from "../componets/Navbar";
import Navegation from "../componets/Navegation";
import { Examenes } from "./Examenes";
import Pacientes from "./Pacientes";
import { Registro } from "./Registro";
const Main = () => {
  const location = useLocation()
  const accion =  parseInt(new URLSearchParams(location.search).get('action'))


  function section() {
    switch (accion) {
      case 1:
        return <Examenes/>;
      case 2:
        return <Pacientes />;
      case 3:
        return <Registro/>;
      default:
        return <div className="container  min-h-screen"></div>;
    }
  }

  return (
    <div className="">
      <Navbar />

      <div className="flex flex-row bg-gray-300 max-h-full overflow-scroll ">
        <Navegation />

        <div className="w-full   overflow-hidden container p-4">
          {section()}

        </div>
      </div>
    </div>
  );
};

export default Main;
